import React from "react";

export default class ContentInfo extends React.Component{
    render(){
        return(
            <div class="content-info">
                <ul>
                    {data.map(item =>
                        <li key={item.id}>
                            <span>{item.until}</span>
                            <p>{item.condition}</p>
                        </li>
                    )}
                </ul>
            </div>
        )
    }
}
